class VDOM_spreadjs(VDOM_object):
    runtime = (server.version >= '2.0')
    
    
    def _render(self): #generic
        id = 'o_' + (self.id).replace('-', '_')
        
        result = u"""
            <!-- <link class="spreadjs-css" rel="stylesheet" href="/55c70287-9a32-15bf-ad26-b4c95ee3676c.css"/> gc.spread.sheets.excel2013white.10.1.0.css -->
            <script src='/e96b87c3-a896-2dea-edc5-af2d8743a95f.js' type='text/javascript'></script> <!-- gc.spread.sheets.all.10.1.0.min.js -->
            <script src='/434472ff-d1ea-b979-440f-af32ad9ca0ae.js' type='text/javascript'></script> <!-- gc.spread.excelio.10.1.0.min.js -->            
        """
      
        result += """<div id="{id}" objname="{objname}" objtype="{objtype}" style="left:{left}px; top: {top}px; position:absolute; width:{width}px; height: {height}px; {display}"></div>""".format(
            id=id,
            objname=self.name,
            objtype='spreadjs',
            left=self.left,
            top=self.top,
            width=self.width,
            height=self.height,
            display="" if self.visible == "1" else "display:none"
        )
      
        result += """
        <script>
        	GC.Spread.Sheets.LicenseKey = "684379132868866#";
            $(document).ready(function () {
                var link = document.createElement('link');
                link.type = "text/css";
                link.rel = "stylesheet";
                link.href = "/55c70287-9a32-15bf-ad26-b4c95ee3676c.css";

                link.onload = function() {
                    function createBlobFromBase64(s) {
                        var byteCharacters = atob(s);
                        var byteNumbers = new Array(byteCharacters.length);
                        for (var i = 0; i < byteCharacters.length; i++) {
                            byteNumbers[i] = byteCharacters.charCodeAt(i);
                        }
                        var byteArray = new Uint8Array(byteNumbers);
                        return new Blob([byteArray], {type: 'application/octet-stream'});
                    }

                    var b64data = "%(spreadsheet_content)s";                    
                    
                    var spread = new GC.Spread.Sheets.Workbook(document.getElementById("%(id)s"));
                    var excelIo = new GC.Spread.Excel.IO();
                    excelIo.open(createBlobFromBase64(b64data), function (json) {
                            var workbookObj = json;
                            spread.fromJSON(workbookObj);
                            spread.sheets.forEach(function(sht, i, arr){ sht.options.isProtected = %(locked)s; })
                        }, function (e) {
                            console.log(e);
                    });
                }

                document.head.appendChild(link);
            });

            </script>
        """ % dict(
            id=id,
            spreadsheet_content=self.content,
            locked='true' if self.locked == "1" else 'false'
        )
        
        return result

    if runtime:
        def render(self, contents=""): #runtime
            return VDOM_object.render(self, contents=self._render()) #runtime   
    else:
        def render(self, parent, contents=""): #1.3
            return VDOM_object.render(self, parent, contents=self._render()) #1.3

    
    def _wysiwyg(self): #generic
        from scripting.legacy.wysiwyg import get_empty_wysiwyg_value

        image_id = "18e2b159-f1f6-529c-e4e8-7af4c3033b41"
        result = get_empty_wysiwyg_value(self, image_id)

        return result

    if runtime:
        def wysiwyg(self, contents=""): #runtime
            return VDOM_object.wysiwyg(self, contents=self._wysiwyg()) #runtime
    else:
        def wysiwyg(self, parent, contents=""): #1.3
            return VDOM_object.wysiwyg(self, parent, contents=self._wysiwyg()) #1.3
